import React, { useState, useEffect } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TableSortLabel,
  Paper,
  TablePagination,
  Collapse,
  IconButton,
  Box,
  Avatar,
  Typography
} from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import { getColumns } from './columns';
import { trackUserInteraction } from '../../utils/analytics';
import ExpandedRow from './ExpandedRow';
import { TrendingUp as TrendingUpIcon, TrendingDown as TrendingDownIcon } from '@mui/icons-material';
import { useTheme } from '@mui/material/styles';
import OpenInNewIcon from '@mui/icons-material/OpenInNew';
import { getPairXToken } from '../../utils/helpers';
import axios from 'axios';

const Row = ({ pair }) => {
  const [open, setOpen] = useState(false);
  const [pairData, setPairData] = useState(null);
  const theme = useTheme();
  const pairXToken = getPairXToken(pair);

  useEffect(() => {
    const fetchPairData = async () => {
      try {
        const response = await axios.get(`https://api.dexscreener.com/latest/dex/pairs/solana/${pair.address}`);
        const data = response.data.pairs?.[0];
        if (data) {
          setPairData(data);
        }
      } catch (err) {
        console.error('Error fetching pair data:', err);
      }
    };

    if (pair.address) {
      fetchPairData();
    }
  }, [pair.address]);

  const handleRowClick = () => {
    setOpen(!open);
    trackUserInteraction.pairClick(pair.pairName);
  };

  const formatNumber = (num) => {
    if (!num) return '0';
    if (num >= 1000000) return `${(num / 1000000).toFixed(2)}M`;
    if (num >= 1000) return `${(num / 1000).toFixed(2)}K`;
    return num.toFixed(2);
  };

  const formatPrice = (price) => {
    if (!price) return '0';
    if (price < 0.001) return price.toFixed(8);
    if (price < 1) return price.toFixed(6);
    return price.toFixed(3);
  };

  if (!pairData) return null;

  return (
    <>
      <TableRow
        hover
        sx={{
          cursor: 'pointer',
          height: '48px',
          '& > td': {
            bgcolor: pair.is_blacklisted ? 'error.lighter' : 'transparent',
            border: 0,
            p: 1,
            color: 'text.secondary',
            fontFamily: 'monospace',
          },
          '&:hover': {
            '& > td': {
              bgcolor: 'rgba(255, 255, 255, 0.03)',
            }
          }
        }}
        onClick={handleRowClick}
      >
        {/* Expand/Collapse */}
        <TableCell sx={{ width: 30 }}>
          <IconButton
            size="small"
            onClick={() => setOpen(!open)}
            sx={{ color: 'text.secondary', p: 0 }}
          >
            <KeyboardArrowDownIcon 
              sx={{ 
                transform: open ? 'rotate(180deg)' : 'none',
                transition: '0.2s'
              }}
            />
          </IconButton>
        </TableCell>

        {/* Pair Name & Info */}
        <TableCell>
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
            <Avatar 
              src={pairData.baseToken?.logoURI || pairXToken?.logoURI} 
              alt={pairData.baseToken?.symbol || pairXToken?.symbol}
              sx={{ width: 24, height: 24 }}
            />
            <Box>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
                <Typography sx={{ fontWeight: 500, color: 'text.primary' }}>
                  {pairData.baseToken?.symbol || pairXToken?.symbol}-{pairData.quoteToken?.symbol}
                </Typography>
                <Typography 
                  sx={{ 
                    color: 'primary.main',
                    bgcolor: 'primary.darker',
                    px: 0.5,
                    py: 0.25,
                    borderRadius: 0.5,
                    fontSize: '0.75rem',
                  }}
                >
                  {pair.version}
                </Typography>
              </Box>
              <Box sx={{ display: 'flex', gap: 1 }}>
                <Typography variant="caption" color="text.secondary">
                  BIN {pair.binStep}
                </Typography>
                <Typography variant="caption" color="text.secondary">
                  {pairData.pairCreatedAt}
                </Typography>
              </Box>
            </Box>
          </Box>
        </TableCell>

        {/* Price */}
        <TableCell align="right">
          <Typography sx={{ fontFamily: 'monospace', fontWeight: 500 }}>
            ${formatPrice(pair.price)}
          </Typography>
        </TableCell>

        {/* Today's Fees */}
        <TableCell align="right" sx={{ color: 'success.main' }}>
          <Typography sx={{ fontWeight: 500 }}>
            ${formatNumber(pair.todayFees)}
          </Typography>
        </TableCell>

        {/* TVL */}
        <TableCell align="right">
          <Typography sx={{ fontWeight: 500 }}>
            ${formatNumber(pair.tvl)}
          </Typography>
        </TableCell>

        {/* APR */}
        <TableCell align="right" sx={{ color: 'success.main' }}>
          <Typography sx={{ fontWeight: 500 }}>
            {pair.apr?.toFixed(2)}%
          </Typography>
        </TableCell>

        {/* Transaction Counts with Buy/Sell bars */}
        {['5m', '1h', '6h', '24h'].map((period) => (
          <TableCell key={period} align="right">
            <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end', gap: 1 }}>
              <Typography>
                {pair[`${period}Txns`]?.total || 0}
              </Typography>
              <Box sx={{ 
                width: 60,
                height: 4,
                borderRadius: 1,
                display: 'flex',
                overflow: 'hidden'
              }}>
                <Box sx={{ 
                  width: `${pair[`${period}Txns`]?.buyPercent || 0}%`,
                  bgcolor: 'success.main'
                }} />
                <Box sx={{ 
                  width: `${pair[`${period}Txns`]?.sellPercent || 0}%`,
                  bgcolor: 'error.main'
                }} />
              </Box>
            </Box>
          </TableCell>
        ))}

        {/* Price Changes */}
        {['5m', '1h', '6h', '24h'].map((period) => (
          <TableCell key={period} align="right">
            <Typography sx={{ 
              color: (pair[`${period}Change`] || 0) >= 0 ? 'success.main' : 'error.main',
            }}>
              {(pair[`${period}Change`] || 0) > 0 ? '+' : ''}{(pair[`${period}Change`] || 0)?.toFixed(2)}%
            </Typography>
          </TableCell>
        ))}

        {/* Volume */}
        {['5m', '1h', '6h', '24h'].map((period) => (
          <TableCell key={period} align="right">
            <Typography sx={{ fontWeight: 500 }}>
              ${formatNumber(pair[`${period}Volume`])}
            </Typography>
          </TableCell>
        ))}

        {/* JOS Score */}
        <TableCell align="right" sx={{ color: 'success.main' }}>
          <Typography sx={{ fontWeight: 500 }}>
            {pair.josScore?.toFixed(2)}
          </Typography>
        </TableCell>

        {/* DEX */}
        <TableCell align="right">
          <Avatar 
            src={pair.dexLogo} 
            alt={pair.dex}
            sx={{ width: 16, height: 16, ml: 'auto' }}
          />
        </TableCell>
      </TableRow>

      {/* Expanded Row */}
      <TableRow>
        <TableCell colSpan={20} sx={{ p: 0, border: 0 }}>
          <Collapse in={open} timeout="auto" unmountOnExit>
            <ExpandedRow pair={pair} />
          </Collapse>
        </TableCell>
      </TableRow>
    </>
  );
};

